function midiaplay(){
 if (jQuery('video')[0]){
   var midia = $('video')[0].player.media;
   var categoria = 'video';
 }else {
   var midia = $('audio')[0].player.media;
   var categoria = 'audio';
 }
 var duracao = midia.duration;
 tempo_assistido = 0;
 tempo_inicio = Math.round(midia.currentTime);
 var urlmidia = midia.src;
 _gaq.push(['_trackEvent',categoria, 'Play',urlmidia]);
};

/* Funcao que detecta o pause na midia **/
function midiapause(){
 if (jQuery('video')[0]){
   var midia = $('video')[0].player.media;
   var categoria = 'video';
 }else {
   var midia = $('audio')[0].player.media;
   var categoria = 'audio';
 }
 tempo_fim = Math.round(midia.currentTime);
 tempo_assistido = Math.round(tempo_fim-tempo_inicio);
 var duracao = Math.round(midia.duration);
 var urlvideo = midia.src;
 var percentual = Math.round((tempo_assistido/duracao)*100);
 if (tempo_assistido<0){
  tempo_assistido = tempo_assistido + duracao;
  percentual = Math.round((tempo_assistido/duracao)*100);
 }
 _gaq.push(['_trackEvent', categoria, 'Pause',urlvideo,tempo_fim]);
 _gaq.push(['_trackEvent', categoria, 'Tempo Assistido', urlvideo,tempo_assistido]);
 _gaq.push(['_trackEvent', categoria, 'Percentual Assistido', urlvideo,percentual]);
};

